import React from 'react';
import { useState } from 'react';



function weathercard(props) {
    const [weathericon, setweathericon] = useState(icon.Absent)


    return (
        <div className="col-md-3">
            <p>Max Temp : {props.data.TEMPMAX_fcast_B17}</p>
            <p>Min Temp : {props.data.TEMPMIN_fcast_B17}</p>
            <p>Precipitation : {props.data.fcast_class_B17}</p>
            <p>Rain: {props.data.rained_B17_yN}</p>
        </div>
    )
}

export default weathercard;
